import React, { useEffect, useState } from "react";
import {
  IconButton,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Tooltip,
} from "@mui/material";
import DeleteIcon from "@mui/icons-material/Delete";
import EditIcon from "@mui/icons-material/Edit";
import { client } from "./Client";
import gql from "graphql-tag";
import { GET_ALL_EMPLOYEE } from "./Queries/Getallquery";
import { useMutation, useQuery } from "@apollo/client";
import { DELETE_EMPLOYEE, UPDATE_EMPLOYEE } from "./Mutations/employeeMutation";
import { Link } from "react-router-dom";

const GetAllEmployees = () => {
  //get
  const { loading, error, data } = useQuery(GET_ALL_EMPLOYEE)
    //delete
    const [deleteEmployee]= useMutation(DELETE_EMPLOYEE)
    const deleteData = (id)=>{
      deleteEmployee({
        variables:{
          id
        },refetchQueries:[
          {query: GET_ALL_EMPLOYEE},
          'getAllEmployees'
        ]
      })

    }

    //update
    const [id, setid] = useState(0);
    const [formData, setFormData] = useState({});
    const [updateEmployee, { load, err }] = useMutation(UPDATE_EMPLOYEE,{
      refetchQueries:[
        {query: GET_ALL_EMPLOYEE},
        'getAllEmployees'
      ]
    });
    const handleClickOpen = (id) => {
      console.log(id)
      setid(id);

    };
    const handleSubmit = (event) => {
      event.preventDefault();
      updateEmployee({ variables: { _id:id, updatedEmployee: formData } });
    };
    const handleChange = (event) => {

      setFormData({
        ...formData,
        [event.target.name]:event.target.value
      });

      if (load) return <p>Loading...</p>;
if (err) {
  console.log(error);
}
    };

  const newArr = data?.getemployees.map((v,index)=> ({...v, SNO: index+1}))

  console.log(newArr)


  if (loading) return <p>Loading...</p>;
  if (error) {
    console.log(error);
  }



  return (
    <>
      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 650 }} aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell>ID</TableCell>
              <TableCell>mongo ID</TableCell>

              <TableCell align="center">FIRSTNAME</TableCell>
              <TableCell align="center">LASTNAME</TableCell>
              <TableCell align="center">SALARY</TableCell>
              <TableCell align="center">DEPARTMENT</TableCell>
              <TableCell align="center">IMAGE</TableCell>
              <TableCell align="center">AGE</TableCell>
              <TableCell align="center">HOBBIES</TableCell>
              <TableCell align="center">DELETE</TableCell>
              <TableCell align="center">UPDATE</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>

            {newArr?.map((e) => (

              <TableRow
                key={e._id}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell component="th" scope="row">
                  {e.SNO}
                </TableCell>
                <TableCell align="center">{e._id}</TableCell>
                <TableCell align="center">{e.firstName}</TableCell>
                <TableCell align="center">{e.lastName}</TableCell>
                <TableCell align="center">{e.salary}</TableCell>
                <TableCell align="center">{e.department}</TableCell>
                <TableCell align="center">{e.image}</TableCell>
                <TableCell align="center">{e.age}</TableCell>
                <TableCell align="center">{e.hobbies}</TableCell>

                <TableCell 
                align="center" 
                onClick={() => deleteData(e._id)}
                >
                <Tooltip title="Delete">
                <IconButton>
                  <DeleteIcon />
                 </IconButton>
                  </Tooltip>
                </TableCell>

                <TableCell
                  align="center"
                  onClick={() => handleClickOpen(e._id)}
                >
                  <EditIcon />
                </TableCell>

              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>


      {/* //update */}
      {/* <form onSubmit={handleSubmit}>
      <label>
        First Name:
        <input type="text" name="firstName"  onChange={handleChange} />
      </label>
      <label>
        Last Name:
        <input type="text" name="lastName"  onChange={handleChange} />
      </label>
      <label>
        Salary:
        <input type="number" name="salary"  onChange={handleChange} />
      </label>
      <label>
        Department:
        <input type="text" name="department"  onChange={handleChange} />
      </label>
      <label>
        Image:
        <input type="text" name="image"  onChange={handleChange} />
      </label>
      <label>
        Age:
        <input type="number" name="age"  onChange={handleChange} />
      </label>
      <label>
        Hobbies:
        <input type="text" name="hobbies"  onChange={handleChange} />
      </label>
      <button type="submit">Update Employee</button>
    </form> */}

    {/* update data */}
    <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Update</DialogTitle>
        <DialogContent>
          <DialogContentText>Update your data</DialogContentText>
          <TextField
            required
            onChange={(e) => setname(e.target.value)}
            id="outlined-basic"
            label="Enter Name"
            margin="dense"
            fullWidth
            variant="filled"
          />

          <TextField
            required
            onChange={(e) => setparent(e.target.value)}
            id="outlined-basic"
            label="Enter Parent Name"
            margin="dense"
            fullWidth
            variant="filled"
          />

          <TextField
            required
            onChange={(e) => setemail(e.target.value)}
            type="email"
            id="filled-basic"
            label="Enter Email"
            margin="dense"
            fullWidth
            variant="filled"
          />
          <TextField
            required
            onChange={(e) => setphone(e.target.value)}
            type="number"
            id="outlined-basic"
            label="Enter Phone No"
            margin="dense"
            fullWidth
            variant="filled"
          />

          <FormControl fullWidth margin="dense">
            <InputLabel id="demo-simple-select-label">Select Class</InputLabel>
            <Select
              required
              onChange={(e) => setclass(e.target.value)}
              labelId="demo-simple-select-label"
              id="demo-simple-select"
              label="Select Class"
            >
              <MenuItem value={1}>Class 1</MenuItem>
              <MenuItem value={2}>Class 2</MenuItem>
              <MenuItem value={3}>Class 3</MenuItem>
              <MenuItem value={4}>Class 4</MenuItem>
              <MenuItem value={5}>Class 5</MenuItem>
              <MenuItem value={6}>Class 6</MenuItem>
              <MenuItem value={7}>Class 7</MenuItem>
              <MenuItem value={8}>Class 8</MenuItem>
              <MenuItem value={9}>Class 9</MenuItem>
              <MenuItem value={10}>Class 10</MenuItem>
              <MenuItem value={11}>Class 11</MenuItem>
              <MenuItem value={12}>Class 12</MenuItem>
            </Select>
          </FormControl>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handledit}>Update</Button>
        </DialogActions>
      </Dialog>
    </>
  );
};

export default GetAllEmployees;
